import React from 'react'
import Salida from './Salida'

export default function Iteracion({datos, removeDato}) {
    return (
        <ul>
            {datos.map(dato => (
                <Salida key={dato.id} dato={dato} removeDato={removeDato} />
            ))}
           
        </ul>
    )
}
